final void seek(long pointer, long p, Term t, TermInfo ti)
        throws IOException {
  input.seek(pointer);
  position = p;
  termBuffer.set(t);
  prevBuffer.reset();
  //System.out.println("  ste doSeek prev=" + prevBuffer.toTerm() + " this=" + this);
  termInfo.set(ti);
  first = p == -1;
}

